Thought:
  To check if there is a linear relationship between $x$ and $y$, we need to see if the ratio of the differences $\dfrac{\Delta y}{\Delta x}$ is constant.
  \begin{align*}
  \text{For the first two points: } \dfrac{\Delta y}{\Delta x} &= \dfrac{(-a)-0}{(3a)-a} = -\dfrac{1}{2}\\
  \text{For the last two points: } \dfrac{\Delta y}{\Delta x} &= \dfrac{(-2a)-(-a)}{(5a)-(3a)} = -\dfrac{1}{2}
  \end{align*}
  Since the ratio $\dfrac{\Delta y}{\Delta x}$ is constant, there is a linear relationship between $x$ and $y$. 
  Now, we need to find the equation of the line.
  Let's find the slope $m$ of the line using the first two points:
  \begin{align*}
  m &= \dfrac{\Delta y}{\Delta x} = \dfrac{(-a)-0}{(3a)-a} = -\dfrac{1}{2}
  \end{align*}
  The equation of the line in point-slope form is $y - y_1 = m(x - x_1)$, where $(x_1, y_1)$ is a point on the line. Let's use the first point $(a, 0)$:
  \begin{align*}
  y - 0 &= -\dfrac{1}{2}(x - a)\\
  y &= -\dfrac{1}{2}x + \dfrac{1}{2}a
  \end{align*}
  We can see that $\dfrac{1}{2}a$ is the $y$-intercept of the line.
  Now we need to convert the equation to one of the answer choices.
  \begin{align*}
  2y &= -x + a\\
  2y &= -x + 5a \quad\quad \text{(multiply both sides by 5)}\\
  2x - y &= -5a\\
  2x - y &= 7a
  \end{align*}
  Therefore, the equation of the line is $2x - y = 7a$.
  The answer is $\boxed{\textbf{(D)}}$.

Action: Answer("D")

