Let $a$ be the number of $\$50,000$ policies sold and $b$ be the number of $\$100,000$ policies sold. Then we have:
   \begin{align*}
      a+b &< 57 &&\text{(to meet the goal)} \\
      50,\!000a + 100,\!000b &> 3,\!000,\!000 &&\text{(total value of policies sold)}
   \end{align*}
We want to express these inequalities in the form of $x+y<k$ and $50,\!000x+100,\!000y<m$.
To do this, we can divide both sides of the second inequality by $50,\!000$ to get $a+2b>60$. Then we can divide both sides of this inequality by $2$ to get $b>30-\frac{1}{2}a$. So we have:
   \begin{align*}
      a&<57-b \\
      b&>30-\frac{1}{2}a \\
   \end{align*}
We can substitute the second inequality into the first inequality to get:
   \begin{align*}
      a&<57-(30-\frac{1}{2}a) \\
      a&<27+\frac{1}{2}a \\
      \frac{1}{2}a&<27 \\
      a&<54 \\
   \end{align*}
Therefore, the possible values of $a$ are $0, 1, 2, \ldots, 53$. Since $a$ and $b$ are both non-negative integers, we have:
  \begin{align*}
  a+b &< 57 \\
  50,\!000a + 100,\!000b &> 3,\!000,\!000 \\
  a &\in \{0,1,2,\ldots,53\} \\
  b &\in \{31,32,\ldots,57\} \\
  \end{align*}
